import React, { Fragment } from "react";
import { connect } from "react-redux";
import SideBar from "../layout/Sidebar";
import Header from "../layout/Header";

const Home = ({ auth }) => {
  if (auth.loading) {
    return <h2 className='loading'>Loading...</h2>;
  }

  return (
    <Fragment>
      <SideBar />
      <div className='main-container'>
        <div className='main-content-container'>
          <Header subtitle='Todays Popular' title='Top Photos' />
          <div className='masonry'>
            <div className='masonry-item' style={{ height: "220px" }}></div>
            <div className='masonry-item' style={{ height: "250px" }}></div>
            <div className='masonry-item' style={{ height: "170px" }}></div>
            <div className='masonry-item' style={{ height: "290px" }}></div>
          </div>
        </div>
      </div>
    </Fragment>
  );
};

const mapStateToProps = state => ({
  auth: state.authReducer
});

export default connect(mapStateToProps)(Home);
